                               C/C++ DERLEYİCİ SEÇENEKLERİ
      
      
                                    -İYİLEŞTİRME-
      
      /O1 en fazla iyileştirme (alana öncelik ver)
      /O2 en fazla iyileştirme (hıza öncelik ver)
      /Ob<n> satır içi genişleme (varsayılan n=0)
      /Od iyileştirmeleri devre dışı bırak (varsayılan)
      /Og genel iyileştirmeyi etkinleştir     /Oi[-] iç işlevleri etkinleştir
      /Os kod alanına ayrıcalık tanı          /Ot kod hızına ayrıcalık tanı
      /Ox iyileştirme (hıza öncelik ver)      
      /favor:<blend|AMD64|INTEL64|ATOM> iyileştirmek için aşağıdakilerden bir işlemci seçin:
          blend - birkaç farklı x64 işlemcisi için iyileştirmelerin bir birleşimi
          AMD64 - 64 bit AMD işlemciler
          INTEL64 - Intel(R)64 mimari işlemcileri
          ATOM - Intel(R) Atom(TM) işlemcileri
      
                                   -KOD OLUŞTURMA-
      
      /Gu[-] ayrı işlevlerin ayrı adreslere sahip olmasını sağlayın
      /Gw[-] bağlayıcı için genel değişkenleri ayırır
      /GF salt okunur dize havuzunu etkinleştir
      /Gy[-] bağlayıcı için ayrı işlevler     
      /GS[-] güvenlik denetimlerini etkinleştir
      /GR[-] C++ RTTI öğesini etkinleştir     
      /guard:cf[-] CFG'yi (denetim akışı koruması) etkinleştir
      /guard:ehcont[-], EH devamlılık meta verilerini (CET) etkinleştirir
      /EHs C++ EH (SEH özel durumu yok) öğesini etkinleştir
      /EHa C++ EH (SEH özel durumlarıyla) öğesini etkinleştir
      /EHc dış "C", varsayılan olarak nothrow şeklindedir
      /EHr her zaman noexcept çalışma zamanı sonlandırma denetimleri oluştur
      /fp:<contract|except[-]|fast|precise|strict> kayan nokta modeli seçin:
          sözleşme - kod oluştururken kayan nokta kısaltmalarını deneyin
          except[-] - kod oluştururken kayan nokta özel durumlarını kullanmayı düşünün
          fast - "fast" kayan nokta modeli; sonuçlar daha az tahmin edilebilirdir
          precise - "precise" kayan nokta modeli; sonuçlar tahmin edilebilirdir
          strict - "strict" kayan nokta modeli (/fp:except gerektirir)
      /Qfast_transcendentals, /fp:except ile bile satır içi FP iç bilgileri oluşturur
      /Qspectre[-] CVE 2017-5753 için azaltıcı etkenleri etkinleştir
      /Qpar[-] paralel kod oluşturmayı etkinleştir
      /Qpar-report:1 otomatik paralel hale getirici tanılaması; paralel hale getirilmiş döngüleri belirtir
      /Qpar-report:2 otomatik paralel hale getirici tanılaması; paralel hale getirilmemiş döngüleri belirtir
      /Qvec-report:1 otomatik vektör haline getirici tanılaması; vektör haline getirilmiş döngüleri belirtir
      /Qvec-report:2 otomatik vektör haline getirici tanılaması; vektör haline getirilmemiş döngüleri belirtir
      /GL[-] bağlantı zamanı kod oluşturmayı etkinleştir
      /volatile:<iso|ms> geçici modeli seçin:
          iso - Alma/bırakma semantiği geçici erişimlerde garanti edilmez
          ms  - Alma/bırakma semantiği geçici erişimlerde garanti edilir
      /GA Windows Uygulaması için iyileştir   
      /Ge tüm işlevler için yığın denetimini zorla
      /Gs[num] yığın denetim çağrılarını denetle
      /Gh _penter işlev çağrısını etkinleştir /GH _pexit işlev çağrısını etkinleştir
      /GT fiber uyumlu TLS erişimleri oluştur 
      /RTC1 Hızlı denetimleri etkinleştir (/RTCsu)
      /RTCc Daha küçük tür denetimlerine dönüştür
      /RTCs Yığın Çerçevesi çalışma zamanı denetimi
      /RTCu Başlatılmamış yerel kullanım denetimleri
      /clr[:option] compile for common language runtime, where option is:
          pure : produce IL-only output file (no native executable code)
          safe : produce IL-only verifiable output file
          netcore : produce assemblies targeting .NET Core runtime
          noAssembly : do not produce an assembly
          nostdlib : ignore the system .NET framework directory when searching for assemblies
          nostdimport : do not import any required assemblies implicitly
          initialAppDomain : enable initial AppDomain behavior of Visual C++ 2002
          implicitKeepAlive- : turn off implicit emission of System::GC::KeepAlive(this)
          char_t- : turn off metadata support for char8_t, char16_t and char32_t
      /fsanitize=address Adres temizleme kodu oluşturmayı etkinleştir
      /homeparams Kayıtlarda geçirilen parametreleri yığına yazılmaya zorla
      /GZ Yığın denetimlerini etkinleştir (/RTCs)
      /Gv __vectorcall çağırma kuralı         
      /arch:<SSE2|SSE4.2|AVX|AVX2|AVX512> minimum CPU mimarisi gereksinimleri, şunlardan biri:
         SSE2 - (varsayılan) SSE2 etkinleştirilmiş CPU'larla kullanılabilen yönergelerin kullanımını etkinleştir
         SSE4.2 - SSE 4.2 etkinleştirilmiş CPU'larla kullanılabilen yönergelerin kullanımını etkinleştir
         AVX - AVX etkinleştirilmiş CPU'larla kullanılabilen yönergelerin kullanımını etkinleştir
         AVX2 - AVX2 etkinleştirilmiş CPU'larla kullanılabilen yönergelerin kullanımını etkinleştir
         AVX512 - AVX-512 etkinleştirilmiş CPU'larla kullanılabilen yönergelerin kullanımını etkinleştir
      /QIntel-jcc-erratum Intel JCC erratum için risk azaltmalarını etkinleştir
      /Qspectre-load Bellek yükleyen tüm yönergeler için Spectre azaltmalarını etkinleştir
      /Qspectre-load-cf Bellek yükleyen tüm denetim akışı yönergeleri için Spectre azaltmalarını etkinleştir
      /Qspectre-jmp[-] Koşulsuz atlama yönergeleri için Spectre risk azaltmalarını etkinleştir
      /fpcvt:<IA|BC> FP'den işaretsiz tamsayıya dönüştürme uyumluluğu
         IA - sonuçlar VCVTTSD2USI yönergesi ile uyumludur
         BC - sonuçlar VS2017 ve önceki derleyici ile uyumludur
      /jumptablerdata .rdata bölümünde switch case deyimleri için atlama tabloları yerleştir
      
